rijven van de afbeelding%3$s</a>. Laat leeg als de afbeelding puur decoratief is.','In this case, WordPress caught an error with one of your plugins, %s.'=>'In dit geval heeft WordPress een fout gevonden met één van uw plugins,%s.','In this case, WordPress caught an error with your theme, %s.'=>'In dit geval heeft WordPress een fout gevonden in uw thema, %s.','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Hallo!

WordPress heeft een ingebouwde functie die detecteert wanneer een plugin of thema een fatale fout veroorzaakt op uw site, en u hiervan op de hoogte stelt met deze geautomatiseerde e-mail.
###CAUSE###
Bezoek eerst uw site (###SITEURL###) en controleer op zichtbare problemen. Bezoek vervolgens de pagina waar de fout is opgetreden (###PAGEURL###) en controleer op zichtbare problemen.

###SUPPORT###

Als uw site er gebroken uitziet en u kunt niet normaal toegang krijgen tot uw dashboard, heeft WordPress nu een speciale "herstelmodus". Hiermee kunt u veilig een login op uw dashboard kunt doen en verder onderzoeken.

###LINK###

Om uw site veilig te houden, verloopt deze link over ###EXPIRES###. Maak u daar echter geen zorgen over: als de fout opnieuw optreedt nadat deze is verlopen, wordt er een nieuwe link naar u gemaild.

Bij het zoeken naar hulp bij dit probleem, kunt u worden gevraagd om enkele van de volgende informatie:
